%snappydata
//Indicate which file to read
var file = "61"

%snappydata
import org.apache.spark.sql._
val snc = new SnappySession(sc)

//*** BEGIN OF CONFIGURATION ***
//******************************

//Table with column names in rows in TDV
val tableName = s"v_uc5_columns_$file"
//Table with results only in TDV
val tableTest = s"v_uc5_datarows_onlytestresults_$file"
//Table with meta data in TDV
val mdtableName = s"v_uc5_metadata_bor_FINAL_$file"
//Table with FINAL TABLE
val finalTable = s"UC5_FINAL_$file"

//*** END OF CONFIGURATION ***
//****************************


//Temp table for row oriented column names which will be REMOVED afterwards
val tableNameCDB = s"app.$tableName"
//Temp table for column oriented column names
val tableCDB = tableNameCDB.concat("_TEMP")
//Temp table to hold the test results in CDB before union
val tableNameTestCDB = s"app.$tableTest"


//FINAL TABLE in CDB where columns and results have been union-ed
val tableResults = tableTest.concat("_RESULT")

%snappydata
val selectQry = s"SELECT * FROM $tableNameCDB"
val df_select = snc.sql(selectQry)
val rows = df_select.collect()

//Start of create table qry
var createQry = s"CREATE TABLE $tableCDB ("
var cols = ""
rows.foreach {
    row => cols = cols + row.get(0).toString.replaceAll("\\s", "") +" NUMERIC, "
}
//Add the ID column
cols = "id INT, " + cols 

//Remove last space and comma
cols = cols.dropRight(2)

//End of create table qry
createQry = s"$createQry $cols) USING COLUMN OPTIONS()"

println(createQry)

%snappydata
//val qry = s"CREATE TABLE IF NOT EXISTS $finalTable USING COLUMN OPTIONS() AS (SELECT * FROM $mdtableName as MD INNER JOIN $tableResults as TR ON MD.ID1 = TR.ID)"
//val res = snc.sql(qry)
snc.sql(s"drop table if exists $finalTable")
val qry = s"CREATE TABLE IF NOT EXISTS $finalTable USING COLUMN OPTIONS() AS (SELECT * FROM $mdtableName as MD INNER JOIN $tableResults as TR ON MD.ID1 = TR.ID)"
val res = snc.sql(qry)

%sql
drop table if exists V_UC5_COLUMNS_60;
drop table if exists V_UC5_COLUMNS_60_TEMP;
drop table if exists UC5_FINAL_60;
drop table if exists V_UC5_DATAROWS_ONLYTESTRESULTS_60;
drop table if exists V_UC5_DATAROWS_ONLYTESTRESULTS_60_RESULT;
drop table if exists V_UC5_METADATA_BOR_FINAL_60;
